import React from 'react';
import classes from './LogoBar.module.css';

const LogoBar = () =>{
    return(
        <div className={classes.LogoBar}>
            <ul className={classes.Logos}>
                <li>
                    twitter
                </li>
                <li>
                    Facebook
                </li>
                <li>
                    instagram
                </li>
            </ul>
        </div>
    );
};

export default LogoBar
